import TodoListItem from "./components/todoListItem";

function App() {
  const dummyData: Todo[] = [
    { text: "task 1", complete: false },
    { text: "another task", complete: false },
  ];
  return (
    <ul>
      <TodoListItem todo={dummyData[0]} />
      <TodoListItem todo={dummyData[1]} />
    </ul>
  );
}

export default App;
